    setData(response.data);
    setLoading(false);
  })
  .catch(error => {
    setError(error);
    setLoading(false);
  });
  const data=axios.get('/')
  .then(response => {
    console.log(response.data);
  })
  .catch(error => {
    console.log(error);
  })
  return (
    <div className="App">
      <h1>Insta App</h1>
      {/* <NewPost></NewPost> */}
      {data}
    </div>
  );
}

export default App;

